import React, { useState } from "react";
function App() {
  const [likes, setLikes] = useState('0')
  const increment = () =>{
    setLikes
  }
  return (
    <div className="App">
      <span>likes:{likes}</span>
      <button onClick={() => likes +=1}>increment</button>
      <button onClick={() => likes -=1}>decrement</button>
    </div>
  );
}

export default App;
